import { createApp } from 'vue';
import App from './App.vue';
import vuetify from './plugins/vuetify'; // Adjust the path as necessary

const app = createApp(App);

app.use(router)
app.use(store)
app.use(vuetify) // Use the Vuetify plugin

app.mount('#app');
